import React, { useState } from 'react';

const GitHubAnalyzer = () => {
  const [username, setUsername] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [result, setResult] = useState(null);

  const handleAnalyze = async (e) => {
    e.preventDefault();
    setError('');
    setResult(null);
    setLoading(true);
    try {
      const response = await fetch('/api/github-analyze', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ username })
      });
      const data = await response.json();
      if (!response.ok) throw new Error(data.error || 'Unknown error');
      setResult(data);
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="min-h-screen bg-slate-900/0 text-white pt-4 px-8 relative overflow-hidden group/bg">
      {/* Interactive background blobs for glassmorphic effect */}
      <div className="fixed inset-0 transition-all duration-700 group-hover/bg:backdrop-blur-sm -z-10">
        <div className="absolute inset-0 opacity-20 group-hover/bg:opacity-30 transition-opacity duration-700">
          <div className="absolute top-0 -left-4 w-96 h-96 bg-purple-500 rounded-full mix-blend-multiply filter blur-xl animate-blob"></div>
          <div className="absolute top-0 -right-4 w-96 h-96 bg-indigo-500 rounded-full mix-blend-multiply filter blur-xl animate-blob animation-delay-2000"></div>
          <div className="absolute -bottom-8 left-20 w-96 h-96 bg-pink-500 rounded-full mix-blend-multiply filter blur-xl animate-blob animation-delay-4000"></div>
        </div>
      </div>

      <div className="max-w-4xl mx-auto relative mt-16">
        {/* AuthentiScan Card */}
        <div className="bg-slate-800/50 backdrop-blur-md rounded-2xl p-8 shadow-xl border border-slate-700/30 mb-8">
          <div className="flex flex-col items-center justify-center">
            <h2 className="text-3xl font-extrabold text-white mb-2 tracking-wide">AuthentiScan</h2>
            <p className="text-base text-white/70 mb-6 max-w-2xl text-center">
              Analyze any GitHub profile for open-source activity, repository health, and contribution patterns. Enter a username below to get an instant, AI-powered breakdown of their public GitHub presence, including a contribution heatmap and a summary of their coding impact.
            </p>
            <form onSubmit={handleAnalyze} className="flex flex-col md:flex-row items-center gap-4 w-full max-w-xl">
              <input
                type="text"
                placeholder="Enter GitHub username"
                value={username}
                onChange={e => setUsername(e.target.value)}
                className="flex-1 px-4 py-2 rounded-lg bg-slate-900 text-white border border-slate-700/30 focus:outline-none focus:ring-2 focus:ring-indigo-500"
                required
              />
              <button
                type="submit"
                className="px-6 py-2 rounded-lg bg-indigo-500 hover:bg-indigo-600 text-white font-semibold transition-colors duration-200 shadow-md"
                disabled={loading}
              >
                {loading ? 'Analyzing...' : 'Analyze'}
              </button>
            </form>
            {error && <div className="text-red-500 mt-4 font-medium">{error}</div>}
          </div>
        </div>

        {/* Results Section */}
        {result && (
          <div className="grid gap-6 grid-cols-1 md:grid-cols-12 mt-8">
            {/* Main Results Section */}
            <div className="md:col-span-8 space-y-6">
              {/* Score Card */}
              <div className="bg-slate-800/30 backdrop-blur-sm rounded-xl p-6 border border-slate-700/30 shadow-lg flex flex-col items-center">
                <h3 className="text-lg font-semibold text-indigo-300 mb-2 tracking-wide">Score</h3>
                <div className="text-4xl font-extrabold text-indigo-400 mb-1">{result.score}/100</div>
              </div>

              {/* Summary Cards */}
              <div className="bg-slate-800/20 backdrop-blur-sm rounded-xl p-6 border border-slate-700/30 shadow-lg">
                <h3 className="text-base font-semibold text-pink-300 mb-2">Summary (Paragraph)</h3>
                <div className="text-base text-white/90 mb-4">
                  {result.summary_paragraph || "No summary paragraph returned from analysis."}
                </div>
                <h3 className="text-base font-semibold text-indigo-300 mb-2">Detailed Summary</h3>
                <pre className="bg-slate-900 text-gray-200 p-4 rounded-lg overflow-x-auto whitespace-pre-wrap text-sm">
                  {result.summary || "No detailed summary returned from analysis."}
                </pre>
              </div>
            </div>
            {/* Heatmap Section */}
            <div className="md:col-span-4 flex flex-col items-center">
              <div className="bg-slate-800/30 backdrop-blur-sm rounded-xl p-6 border border-slate-700/30 shadow-lg w-full flex flex-col items-center">
                <h3 className="text-base font-semibold text-green-300 mb-2">Contribution Heatmap</h3>
                <img
                  src={`data:image/png;base64,${result.heatmap}`}
                  alt="Contribution Heatmap"
                  className="rounded-lg border border-slate-700"
                  style={{ maxWidth: '100%' }}
                />
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default GitHubAnalyzer;
